(26, 4, 62, 0, 5, 'Just like the perfect frame can make your movie poster a piece of sophisticated art, the perfect spectacles enhance your gorgeous mug. Hang a frame on your facial features with today’s deal. For $25, you get $175 toward one complete pair of eyewear—frames and lenses—from Brookside Optical. Redeem today’s Groupon at any of Brookside Optical’s three Kansas City–area locations. Your $175 credit must be used for a complete pair of eyewear (you cannot apply the value toward frames or lenses only).'),
