(42, 4, 543, 0, 5, '<iframe width="210" height="197" frameborder="0" scrolling="no" marginheight="0" marginwidth="0" src="http://maps.google.com/maps?f=q&amp;source=s_q&amp;hl=en&amp;geocode=&amp;q=Charles+Elena+Design,+197+Lonsdale+Street,+Melbourne+3000,+Australia&amp;sll=35.746512,-76.113281&amp;sspn=72.706031,173.144531&amp;ie=UTF8&amp;hq=Charles+Elena+Design,&amp;hnear=197+Lonsdale+St,+Melbourne+Victoria+3000,+Australia&amp;ll=-37.811257,144.966554&amp;spn=0.006295,0.006295&amp;output=embed"></iframe>'),
(43, 4, 61, 0, 6, '<p>Crafting your way into someone''s cupboard is the craftiest way into their heart: for $15, you get $30 toward pottery painting and glass fusing at Studio 6 Pottery. The cozy studio in Ocoee welcomes all ages and experience levels.</p>\r\n<p>Studio 6''s cheerful pottery palace is a great place to get friends together for a small ceramics gathering, ceramics rave, or first ceramics date rave.</p>'),
(44, 4, 525, 0, 6, 'Studio 6 Pottery,<br>\r\n2910 S Maguire Rd,<br>\r\nSuite 1003,<br>\r\nOcoee, Florida 34761.'),
(45, 4, 543, 0, 6, '<iframe width="200" height="200" frameborder="0" scrolling="no" marginheight="0" marginwidth="0" src="http://maps.google.com/maps?f=q&amp;source=s_q&amp;hl=en&amp;geocode=&amp;q=chennai,india&amp;sll=37.0625,-95.677068&amp;sspn=38.554089,86.572266&amp;ie=UTF8&amp;hq=&amp;hnear=Chennai,+Tamil+Nadu,+India&amp;z=12&amp;ll=13.060416,80.249634&amp;output=embed"></iframe><br />'),
(46, 4, 72, 0, 6, 'Paint-Your-Own Pottery,Glass Fusing'),
(47, 4, 61, 0, 7, '<p>People have been dreaming about video calling for decades. iPhone 4 makes it a reality. With the tap of a button, you can wave hello to your kids, share a smile from across the globe, or watch your best friend laugh at your stories — iPhone 4 to iPhone 4 over Wi-Fi. No other phone makes staying in touch this much fun.</p>\r\n<p>iPhone 4 has two built-in cameras, one on the front above the display and one on the back next to the LED flash. The front camera has been tuned for FaceTime. It has just the right field of view and focal length to focus on your face at arm’s length. So it always presents you in the best possible light.Imagine your sister is away at school and can’t make it to your son’s birthday. So you’re cheering her up with a FaceTime call. As the cupcakes come out, your son’s eyes light up, and you just have to share it. Tap a button, and before you can say, “Make a wish,” iPhone 4 switches to the back camera, and to the birthday boy''s big moment. Another tap switches back to the front camera and to you. Simple, fast, and fun.</p>'),
(48, 4, 525, 0, 7, 'Iphone,<br>\r\n2910 S Maguire Rd,<br>\r\nSuite 1003,<br>\r\nOcoee, Florida 34761.'),
(49, 4, 543, 0, 7, '<iframe width="200" height="200" frameborder="0" scrolling="no" marginheight="0" marginwidth="0" src="http://maps.google.com/maps?f=q&amp;source=s_q&amp;hl=en&amp;geocode=&amp;q=california&amp;sll=37.0625,-95.677068&amp;sspn=30.048013,86.572266&amp;ie=UTF8&amp;hq=&amp;hnear=California&amp;ll=35.532226,-111.357422&amp;spn=30.626839,86.572266&amp;z=4&amp;output=embed"></iframe><br /><small></small>'),
(50, 4, 72, 0, 7, 'iphone'),
