(86, 4, 61, 0, 11, '<p>Hillary Clinton''s presidential campaign may be dead, but she''s determined to see this t-shirt contest thing through to the end. After receiving "almost 5,000 amazing entries" and more than 125,000 online votes, the contest has picked a winner (pictured at left). Designed by "Denitza of Weehawken, New Jersey" (which sounds like a circa-1930s purveyor of charming ladies'' chapeaux), the winning design is heavy on the text. Set in a Matt Groening-flavored typeface is the catchy slogan: "For everyone who''s ever been counted out but refused to be knocked out and for everyone who works hard but never gives up, this one [insert silhouette of Hillary, standing at attention in a pantsuit and kitten heels] is for you!" The "limited-edition t-shirt" can be yours for a $50 contribution, which will go toward paying down Hillary''s campaign debt. As for the design, noted Hillary in a letter to supporters, "it won by a landslide.</p>\r\n<p>Get a jump on the day with Mediabistro''s Morning Media Newsfeed. We''ll send you an email before 9 am with fifteen stories that everyone in the industry should know about before they get to work.We cover everything from breaking updates on major media deals to think pieces from journals you wouldn''t usually check out.</p>'),
