(98, 4, 61, 0, 12, '<p>One HOTT deal a day for Restaurants, Bars/Clubs, Spas, Salons, Parks and Recreation, Retail, and Entertainment.  Deal Me One is out to find you the best possible option for your hard earned dollar.</p>\r\n<p><strong>1)</strong> We start by hunting down the best deals in your area</p>\r\n<p><strong>2)</strong> We offer the Deal at the best possible price and exclusively for Deal Me One customers</p>\r\n<p><strong>3)</strong> As long as we reach the minimum number of Deal Me One buyers everyone gets the benefits of the deal. If the deal doesn''t reach the sufficient number of buyers your credit cards will NEVER be charged (this is why billing information is processed within 24hrs of the deals closing)</p>\r\n<p><strong>4)</strong> Once its a "Done Deal" and your credit card has been charged you will recive a printable "Deal Card" via email</p>\r\n<p><strong>5)</strong> Remember to bring your Deal Card and PHOTO ID to the business and ENJOY YOUR DEAL AND DEALS TO COME!</p>'),
