(9, 'Business Recommendations', 'two_columns_right', '', '', 'recommend-business', '', '<p>{{block type="bd/bd" template="bd/bd.phtml"}}</p>', '2010-06-17 09:19:23', '2010-06-17 09:22:50', 1, 0, '<reference name="right">\r\n                <block type="newsletter/subscribe" name="right.newsletter" template="newsletter/subscribe.phtml"/>\r\n            <block type="fido_example/view" name="right.example" template="example/view.phtml" />\r\n<block type="buyfriend/buyfriend" name="right.buyfriend" template="buyfriend/buyfriend.phtml" />\r\n         </reference>', '', '', '', NULL, NULL),
(10, 'Refer a Charity', 'two_columns_right', '', '', 'refer-charity', '', '<p>{{block type="rchar/rchar" template="rchar/rchar.phtml"}}</p>', '2010-06-17 09:51:17', '2010-06-17 09:51:17', 1, 0, '<reference name="right">\r\n                <block type="newsletter/subscribe" name="right.newsletter" template="newsletter/subscribe.phtml"/>\r\n            <block type="fido_example/view" name="right.example" template="example/view.phtml" />\r\n<block type="buyfriend/buyfriend" name="right.buyfriend" template="buyfriend/buyfriend.phtml" />\r\n         </reference>', '', '', '', NULL, NULL),
(11, 'Terms', 'two_columns_right', '', '', 'Terms', '', '<div id="business">\r\n<h2 style="font-size: 1.5em;">Terms And Conditions</h2>\r\n<img style="border-width: 0px; vertical-align: middle;" src="{{media url="/titlebottom.jpg"}}" alt="" />\r\n<p class="business-toptxt">&nbsp;</p>\r\n<p class="business-toptxt"><span class="dealtxtcolor">Groupclone<span class="Apple-converted-space">&nbsp;</span></span>offers one fantastic deal every day with discounts of up to 90% at local restaurants, bars, spas, theaters, and more.</p>\r\n<h3 style="font-size: 1.17em;">Brand Awareness and Desirable Customers</h3>\r\n<p>Groupclone offers the most efficient and cost-effective way to bring you the one thing you''ve always wanted from advertising - customers!</p>\r\n<h3 style="font-size: 1.17em;">Track Results</h3>\r\n<p>You''ll know exactly how many customers to expect and how your business is benefiting from our partners and our partnership.</p>\r\n<h3 style="font-size: 1.17em;">Advertise for FREE</h3>\r\n<p>There is no upfront cost. Delivering customers is the only way we get paid. Even if we don''t make the deal your company&nbsp;logo and&nbsp;info is viewed by hundreds of our daily customers&nbsp;creating more brand awareness FREE.</p>\r\n<h3 style="font-size: 1.17em;">Build a Loyal Clientele</h3>\r\n<p class="businesstxt"><span class="txtcolor"><a href="customer/account/create/">Sign up</a></span><span class="Apple-converted-space">&nbsp;</span>with no obligation to automatically receive daily email alerts with highlights of your city&rsquo;s Deal of the Day.</p>\r\n<p class="businesstxt">Still have questions? No problem, you can<span class="Apple-converted-space">&nbsp;</span><span class="txtcolor"><a href="http://groupclone.net/index.php/contacts">contact us!</a></span></p>\r\n</div>', '2010-08-11 04:56:04', '2010-08-11 05:12:28', 1, 0, '<reference name="right">\r\n                <block type="newsletter/subscribe" name="right.newsletter" template="newsletter/subscribe.phtml"/>\r\n            <block type="fido_example/view" name="right.example" template="example/view.phtml" />\r\n<block type="buyfriend/buyfriend" name="right.buyfriend" template="buyfriend/buyfriend.phtml" />\r\n         </reference>', '', '', '', NULL, NULL),
(12, 'Sample of sponsorship principles', 'two_columns_right', 'Sponsorship', 'Information on sponsorship', 'sponsorship_info', 'Sample of sponsorship principles', '<p>By sponsoring friends you can earn:</p>\r\n<ul class="disc">\r\n<li>Cash</li>\r\n<li>Vouchers</li>\r\n</ul>\r\n<p>Every time one of your godson order, you win 5% of its order !</p>\r\n<p>But that''s not all, if your godson sponsors too, you earn 50% of what your godson has won...</p>\r\n<p>For example,</p>\r\n<ul class="disc">\r\n<li>your godson place an order of 100 euros (you win 5 points)</li>\r\n<li>your godson sponsors 2 friends who order 100 euros each (you win 5 points)</li>\r\n<li>the godchildren of your godson each sponsor 2 people who order 100 euros each (you win 5 points)...</li>\r\n</ul>\r\n<p>Then you can exchange your points into cash or vouchers.</p>\r\n<p style="text-align:right;"><a href="../sponsorship">Yes I want sponsors friends to earn cash or vouchers !</a></p>', '2010-08-24 12:41:00', '2010-08-24 12:41:00', 1, 0, '', '', '', NULL, NULL, NULL),
