INSERT INTO `magentocore_email_template` (`template_id`, `template_code`, `template_text`, `template_styles`, `template_type`, `template_subject`, `template_sender_name`, `template_sender_email`, `added_at`, `modified_at`, `orig_template_code`, `orig_template_variables`) VALUES
(1, '{{config path="general/store_information/name"}} email confirmation', '<div style="font:11px/1.35em Verdana, Arial, Helvetica, sans-serif;">\r\n<table cellspacing="0" cellpadding="0" border="0" width="98%" style="margin-top:10px; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; margin-bottom:10px;">\r\n<tr>\r\n    <td align="center" valign="top">\r\n        <!-- [ header starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n            <tr>\r\n                <td valign="top"><a href="{{store url=""}}"><img src="{{skin url="images/logo_email.png" _area=''frontend''}}" alt="{{var store.getFrontendName()}}"  style="margin-bottom:10px;" border="0"/></a></td>\r\n            </tr>\r\n        </table>\r\n        <!-- [ middle starts here] -->\r\n        <table cellspacing="0" cellpadding="0" border="0" width="650">\r\n            <tr>\r\n                <td valign="top">\r\n                    <p>\r\n                        <strong>Hello {{htmlescape var=$order.getCustomerName()}}</strong>,<br/>\r\n                        Thank you for your Deal from {{var store.getFrontendName()}}.\r\n                        Once your package ships we will send an email with a link to track your order.\r\n                        You can check the status of your order by <a href="{{store url="customer/account/"}}" style="color:#1E7EC8;">logging into your account</a>.\r\n                        If you have any questions about your order please contact us at <a href="mailto:{{config path=''trans_email/ident_support/email''}}" style="color:#1E7EC8;">{{config path=''trans_email/ident_support/email''}}</a> or call us at <span class="nobr">{{config path=''general/store_information/phone''}}</span> Monday - Friday, 8am - 5pm PST.\r\n                    </p>\r\n                    <p>Your deal confirmation is below. Thank you again for your business.</p>\r\n\r\n                    <h3 style="border-bottom:2px solid #eee; font-size:1.05em; padding-bottom:1px; ">Your Deal#{{var order.increment_id}} <small>(placed on {{var order.getCreatedAtFormated(''long'')}})</small></h3>\r\n                    <table cellspacing="0" cellpadding="0" border="0" width="100%">\r\n                        <thead>\r\n                        <tr>\r\n                            <th align="left" width="48.5%" bgcolor="#d9e5ee" style="padding:5px 9px 6px 9px; border:1px solid #bebcb7; border-bottom:none; line-height:1em;">Billing Information:</th>\r\n                        </tr>\r\n                        </thead>\r\n                        <tbody>\r\n                        <tr>\r\n                            <td valign="top" style="padding:7px 9px 9px 9px; border:1px solid #bebcb7; border-top:0; background:#f8f7f5;">\r\n                                {{var order.getBillingAddress().format(''html'')}}\r\n                            </td>\r\n                        </tr>\r\n                        </tbody>\r\n                    </table>\r\n                    <br/>\r\n                    {{depend order.getIsNotVirtual()}}\r\n                    <table cellspacing="0" cellpadding="0" border="0" width="100%">\r\n                        <thead>\r\n                        <tr>\r\n                            <th align="left" width="48.5%" bgcolor="#d9e5ee" style="padding:5px 9px 6px 9px; border:1px solid #bebcb7; border-bottom:none; line-height:1em;">Shipping Information:</th>\r\n                            <th width="3%"></th>\r\n                            <th align="left" width="48.5%" bgcolor="#d9e5ee" style="padding:5px 9px 6px 9px; border:1px solid #bebcb7; border-bottom:none; line-height:1em;">Shipping Method:</th>\r\n                        </tr>\r\n                        </thead>\r\n                        <tbody>\r\n                        <tr>\r\n                            <td valign="top" style="padding:7px 9px 9px 9px; border:1px solid #bebcb7; border-top:0; background:#f8f7f5;">\r\n                                {{var order.getShippingAddress().format(''html'')}}\r\n                                &nbsp;\r\n                            </td>\r\n                            <td>&nbsp;</td>\r\n                            <td valign="top" style="padding:7px 9px 9px 9px; border:1px solid #bebcb7; border-top:0; background:#f8f7f5;">\r\n                                {{var order.getShippingDescription()}}\r\n                                &nbsp;\r\n                            </td>\r\n                        </tr>\r\n                        </tbody>\r\n                    </table>\r\n                    <br/>\r\n                    {{/depend}}\r\n                    {{layout handle="sales_email_order_items" order=$order}}\r\n                    <br/>\r\n                    {{var order.getEmailCustomerNote()}}\r\n                    <p>Thank you again,<br/><strong>{{var store.getFrontendName()}}</strong></p>\r\n                </td>\r\n            </tr>\r\n        </table>\r\n    </td>\r\n</tr>\r\n</table>\r\n</div>', 'body,td { color:#2f2f2f; font:11px/1.35em Verdana, Arial, Helvetica, sans-serif; }', 2, '{{var store.getFrontendName()}}: Your Deal Number # {{var order.increment_id}}', NULL, NULL, '2010-05-25 07:54:14', '2010-09-24 11:50:49', 'sales_email_order_template', '{"store url=\\"\\"":"Store Url","skin url=\\"images/logo_email.gif\\" _area=''frontend''":"Email Logo Image","htmlescape var=$order.getCustomerName()":"Customer Name","var store.getFrontendName()":"Store Name","store url=\\"customer/account/\\"":"Customer Account Url","var order.increment_id":"Order Id","var order.getCreatedAtFormated(''long'')":"Order Created At (datetime)","var order.getBillingAddress().format(''html'')":"Billing Address","var payment_html":"Payment Details","var order.getShippingAddress().format(''html'')":"Shipping Address","var order.getShippingDescription()":"Shipping Description","layout handle=\\"sales_email_order_items\\" order=$order":"Order Items Grid","var order.getEmailCustomerNote()":"Email Order Note"}'),
(2, 'Coupon Template', '<table   style="border:5px solid #dbdbdb;"  border="5"  cellpadding="0" cellspacing="0" rules="groups" width="590"     >\r\n            <tr>\r\n                <td width="20"></td>\r\n                 <td valign="top" width="470">\r\n                            <p><a href="{{store url=''''}}" style="color:#1E7EC8;"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var store.getFrontendName()}}" border="0"/></a></p></td>\r\n                <td width="120"><img src="{{skin url="images/sale.jpg" _area=''frontend''}}"  width="107" height="67"/></td>\r\n            </tr>\r\n            <tr>\r\n                <td colspan="3" height="10"></td>\r\n            </tr>\r\n        </table>\r\n        <table   bordercolor=""   cellpadding="0" cellspacing="0" rules="cols" width="580"  style="border-left:5px solid #DBDBDB;border-right:5px solid #DBDBDB;"    >\r\n            <tr>\r\n                <td>\r\n                    <table cellpadding="0" cellspacing="0">\r\n                        <tr>\r\n                            <td height="20" colspan="3"></td>\r\n                        </tr>\r\n                    </table>\r\n                </td>\r\n            </tr>\r\n            <tr>\r\n                <td >\r\n                    <table cellpadding="0" cellspacing="0" width="580">\r\n                        <tr>\r\n\r\n                            <td width="20"></td>\r\n                            <td width="586">{{var deallist.Productname}}</td>\r\n                           \r\n                        </tr>\r\n                    </table>\r\n                </td>\r\n            </tr>\r\n            <tr>\r\n                <td>\r\n                    <table cellpadding="0" cellspacing="0">\r\n                        <tr>\r\n                            <td colspan="3" height="20"></td>\r\n\r\n                        </tr>\r\n                    </table>\r\n                </td>\r\n\r\n            </tr>\r\n            <tr>\r\n                <td>\r\n                    <table cellpadding="0" cellspacing="0">\r\n                        <tr>\r\n                            <td valign="top" width="170">\r\n                                <table cellpadding="0" cellspacing="0">\r\n                                    <tr>\r\n                                        <td background="{{skin url=''images/worthimg.jpg'' _area=''frontend''}}"  width="170" height="130" style="background-repeat:no-repeat;">    <table cellpadding="0" cellspacing="0">\r\n                                                <tr>\r\n                                                    <td height="30"></td>\r\n                                                </tr>\r\n                                                <tr>\r\n                                                    <td align="center" width="170"><font face="Georgia" size="6 " color="#333" ><strong> $ {{var deallist.discount}}</strong></font></td>\r\n                                                </tr>\r\n\r\n                                            </table>\r\n                                        </td>\r\n                                    </tr>\r\n                                    <tr>\r\n                                        <td height="10"></td>\r\n\r\n                                    </tr>\r\n                                    <tr>\r\n                                        <td>\r\n                                        <table cellpadding="0" cellspacing="0">\r\n                                            <tr>\r\n                                                <td width="10"></td>\r\n                                                <td><font face="Arial" size="2" color="#666">{{var deallist.product_description}}</font></td>\r\n                                            </tr>\r\n\r\n                                        </table> </td>\r\n                                   </tr>\r\n                                   \r\n\r\n                                   \r\n                                   \r\n                                    <tr>\r\n\r\n                                    <td>\r\n                                        <table cellpadding="0" cellspacing="0">\r\n                                            <tr>\r\n                                                <td width="10"></td>\r\n                                                 <td><font color="#0066CC"><a href="{{var deallist.Companywebsite}}">{{var deallist.Companywebsite}}</a></font></td>\r\n                                            </tr>\r\n\r\n                                        </table> </td>\r\n\r\n                                    </tr>\r\n                                </table>\r\n                            </td>\r\n                            <td width="390"  valign="top"><img src="{{var deallist.Productimage}}" width="400" height="306"/></td>\r\n                        </tr>\r\n\r\n                    </table>\r\n                </td>\r\n            </tr>\r\n            <tr>\r\n            <td ><img src="{{skin url=''images/borderimg.jpg'' _area=''frontend''}}"  width="580" height="4"/></td></tr>\r\n            <tr>\r\n\r\n                <td></td>\r\n\r\n            </tr>\r\n\r\n            <tr>\r\n                <td height="20"></td>\r\n\r\n            </tr>\r\n            <tr>\r\n                <td valign="top">\r\n                    <table cellpadding="0" cellspacing="0">\r\n\r\n                        <tr>\r\n\r\n                            <td width="30"></td>\r\n                            <td valign="top">\r\n                                <table cellpadding="0" cellspacing="0">\r\n                                    <tr>\r\n                                        <td width="90"><font face="Arial" size="2" color="#666">Name</font></td>\r\n                                        <td width="10">:</td>\r\n                                        <td><font face="Georgia" size="2" color="#333"><strong>{{var deallist.Customer_name}}</strong></font></td>\r\n                                    </tr>\r\n                                    <tr>\r\n                                        <td width="90"><font face="Arial" size="2" color="#666">Coupon ID</font></td>\r\n                                        <td width="10">:</td>\r\n                                        <td><font face="Georgia" size="2" color="#333"><strong>{{var deallist.Couponcode}}</strong></font></td>\r\n                                    </tr>\r\n                                    <tr>\r\n                                        <td width="90"><font face="Arial" size="2" color="#666">Valid Upto</font></td>\r\n                                        <td width="10">:</td>\r\n                                        <td><font face="Georgia" size="2" color="#333"><strong>{{var deallist.Couponvalid}}</strong></font></td>\r\n                                    </tr>\r\n <tr>\r\n                                        <td width="90"><font face="Arial" size="2" color="#666">Gift Message:</font></td>\r\n                                        <td width="10">:</td>\r\n                                        <td><font face="Georgia" size="2" color="#333"><strong>{{var deallist.message}}</strong></font></td>\r\n                                    </tr>\r\n                                </table>\r\n                            </td>\r\n                            <td width="30"></td>\r\n\r\n\r\n                            <td>\r\n                                <table cellpadding="0" cellspacing="0">\r\n                                    <tr>\r\n                                        <td><font color="#333" size="6" face="Arial">YOU SAVE&nbsp; </font></td>\r\n                                        <td><font color="#999" size="6" face="Arial"><strong>{{var deallist.discount}} </strong></font></td>\r\n                                        <td><font color="#333" size="6" face="Arial"><strong>&nbsp;%</strong></font></td>\r\n                                    </tr>\r\n                                </table>\r\n                            </td>\r\n\r\n                        </tr>\r\n                    </table>\r\n                </td>\r\n            </tr>\r\n        </table>\r\n        <table cellpadding="0" cellspacing="0">\r\n            <tr>\r\n                <td background="{{skin url=''images/emailbottombg.jpg'' _area=''frontend''}}"  width="590" height="48" >\r\n                <table cellpadding="0" cellspacing="0">\r\n                <tr>\r\n                <td width="80"></td>\r\n                <td>\r\n                                       \r\n                    <font face="Arial" color="#666" size="1">Email us:</font> <a href="mailto:{{config path=''trans_email/ident_support/email''}}"><font face="Arial" color="#0099CC" size="1">{{config path=''trans_email/ident_support/email''}}</font></a><font face="Arial" color="#666" size="1">  Call us: {{config path=''general/store_information/phone''}}</font>\r\n                    </td>\r\n                </tr></table>\r\n                \r\n                </td>\r\n            </tr>\r\n        </table>', '', 2, '{{var deallist.subjectname}}', NULL, NULL, '2010-08-20 06:18:54', '2010-10-23 13:16:23', 'catalog_product_email_template', ''),
(3, 'Newsletter', '<div style="margin: auto; padding: 10px; width: 720px;">\r\n    \r\n    <table width="720" cellspacing="0" cellpadding="0">\r\n      <tbody><tr>\r\n        <td>\r\n          <p style="margin: 0px; text-align: center; font-size: 11px; font-family: Helvetica,Arial,sans-serif; color: rgb(146, 146, 146);">\r\n            Your Daily\r\n            {{var deallist.product_city}}\r\n            {{var store.getFrontendName()}}   \r\n                          \r\n          </p>\r\n          <p style="margin: 0px; text-align: center; font-size: 11px; font-family: Helvetica,Arial,sans-serif; color: rgb(146, 146, 146);">\r\n            Be sure to add\r\n            <a target="_blank" title="{{var store.getFrontendName()}} Email" style="color: rgb(9, 129, 190);" href="{{config path=''trans_email/ident_support/email''}}">{{config path=''trans_email/ident_support/email''}}</a>\r\n            to your address book or safe sender list so our emails get to your inbox.\r\n            <a target="_blank" title="White List {{var store.getFrontendName()}}" style="color: rgb(9, 129, 190);" href="{{store url=''''}}">Learn how</a>\r\n          </p>\r\n        </td>\r\n      </tr>\r\n    </tbody></table>\r\n    <div style="border: 5px solid rgb(222, 237, 204); margin: 5px 0pt; padding: 20px; width: 670px; background-color: rgb(134, 173, 83); background-repeat: no-repeat;">\r\n      <table width="720" cellspacing="0" cellpadding="0" style="background-color: rgb(255, 255, 255);">\r\n        \r\n        <tbody><tr>\r\n          <td colspan="2"><div style="border-bottom: 4px solid rgb(75, 139, 155); margin: 0pt; min-height: 104px;">\r\n              <table height="104" width="670" cellspacing="0" cellpadding="0" bgcolor="#313131">\r\n                <tbody><tr>\r\n                  <td valign="top" style="padding: 18px 0pt 0pt 15px; width: 110px; min-height: 37px;"><a href="{{store url=""}}" target="_blank" style="color:#1E7EC8;"><img src="{{skin url="images/logo_email.gif" _area=''frontend''}}" alt="{{var store.getFrontendName()}}" border="0"/></a></td>\r\n                  <td valign="top" style="padding-left: 15px; width: 250px; padding-top: 16px;">\r\n                    <table>\r\n                      <tbody><tr>\r\n                        <td style="margin: 0pt; color: rgb(255, 255, 255); font-size: 12px; font-weight: 700; font-family: Helvetica,Arial,sans-serif;">\r\n                          The Daily Deal for\r\n                        </td>\r\n                      </tr>\r\n                      <tr>\r\n                        <td style="margin: 0pt; padding: 5px 0pt 0pt; color: rgb(255, 255, 255); font-size: 20px; font-weight: 700; font-family: Helvetica,Arial,sans-serif;">\r\n                         {{var deallist.product_city}}\r\n                        </td>\r\n                      </tr>\r\n                    </tbody></table>\r\n                  </td>\r\n                  <td valign="top" align="right" style="padding-right: 20px; padding-top: 21px;">\r\n                    <table width="225" cellspacing="0" cellpadding="0">\r\n                      <tbody><tr>\r\n                        <td align="right" style="margin: 0pt; color: rgb(255, 255, 255); font-size: 12px; font-family: Helvetica,Arial,sans-serif;">\r\n                          {{var deallist.deal_date}}\r\n                        </td>\r\n                      </tr>\r\n                 \r\n                    </tbody></table>\r\n                  </td>\r\n                </tr>\r\n              </tbody></table>\r\n            </div></td>\r\n        </tr>\r\n        \r\n        <tr>\r\n          <td valign="top" style="border-top: 10px solid rgb(75, 193, 222); padding: 20px 0pt 25px;">\r\n            <table width="720" cellspacing="0" cellpadding="0">\r\n              \r\n              <tbody><tr>\r\n                <td colspan="2">\r\n                  <h1 style="margin: 0pt; padding: 0pt 20px 20px;"><a href="{{store url=''''}}" target="_blank" style="color:#1E7EC8;"> {{var deallist.Productname}}</a></h1>\r\n                </td>\r\n              </tr>\r\n              \r\n              <tr>\r\n                <td valign="top" style="\r\nbackground:#E4E6E5 none repeat scroll 0 0;\r\nborder:1px solid #CCCCCC;\r\nmargin:0 0 0 10px;\r\npadding:10px 0 0 10px;\r\nwidth:238px;">\r\n                  <table height="60" width="262" cellspacing="0" cellpadding="0" bgcolor="#4bc1dd" background="{{skin url=''images/buynowbg.jpg'' _area=''frontend''}}">\r\n                    <tbody><tr>\r\n                      <td style="padding-left: 35px; font-size: 28px; color: rgb(255, 255, 255); font-family: Helvetica,Arial,sans-serif;">\r\n                        <div>\r\n                          {{var deallist.product_price }}\r\n                        </div>\r\n                      </td>\r\n                      <td style="padding-top: 5px;">\r\n                        <a target="_blank" title="{{var deallist.Productname}}" href="{{store url=''''}}"><img  style="border: medium none ;" src="{{skin url=''images/buynow_btn.jpg'' _area=''frontend''}}" alt="See Today''s  Deal"/></a>\r\n                      </td>\r\n                      <td style="padding-top: 5px;">\r\n                        <a target="_blank" title="{{var deallist.Productname}}" href="{{store url=''''}}"><img height="35" width="40" style="border: medium none ;" src="{{skin url=''images/buynow-arrow.jpg'' _area=''frontend''}}" alt="See Today''s  Deal"/></a>\r\n                      </td>\r\n                    </tr>\r\n                  </tbody></table>\r\n                  <div >\r\n                    <table width="262" cellspacing="0" cellpadding="0">\r\n                      <tbody><tr style="background-color: rgb(208, 238, 246);">\r\n                        <td width="33%" align="center" style="border-left: 1px solid rgb(75, 193, 221); margin: 0pt; padding: 10px 0pt 5px; font-size: 15px; color: rgb(0, 0, 0); font-family: Helvetica,Arial,sans-serif;font-weight:bold;">\r\n                          worth\r\n                        </td>\r\n                        <td width="33%" align="center" style="margin: 0pt; padding: 10px 0pt 5px; font-size: 15px;font-weight:bold; color: rgb(0, 0, 0); font-family: Helvetica,Arial,sans-serif;">\r\n                          discount\r\n                        </td>\r\n                        <td width="33%" align="center" style="border-right: 1px solid rgb(75, 193, 221); margin: 0pt; padding: 10px 0pt 5px; font-size: 15px; font-weight:bold;color: rgb(0, 0, 0); font-family: Helvetica,Arial,sans-serif;">\r\n                          savings\r\n                        </td>\r\n                      </tr>\r\n                      <tr style="background-color: rgb(208, 238, 246);">\r\n                        <td width="33%" align="center" style="border-left: 1px solid rgb(75, 193, 221); border-bottom: 1px solid rgb(75, 193, 221); margin: 0pt; padding: 0pt 0pt 5px; font-size: 20px; font-weight: 700; color: rgb(0, 0, 0); font-family: Helvetica,Arial,sans-serif;">\r\n                         {{var deallist.product_worth}}\r\n                        </td>\r\n                        <td width="33%" align="center" style="border-bottom: 1px solid rgb(75, 193, 221); margin: 0pt; padding: 0pt 0pt 5px; font-size: 20px; font-weight: 700; color: rgb(0, 0, 0); font-family: Helvetica,Arial,sans-serif;">\r\n                          {{var deallist.discount}}%\r\n                        </td>\r\n                        <td width="33%" align="center" style="border-right: 1px solid rgb(75, 193, 221); border-bottom: 1px solid rgb(75, 193, 221); margin: 0pt; padding: 0pt 0pt 5px; font-size: 20px; font-weight: 700; color: rgb(0, 0, 0); font-family: Helvetica,Arial,sans-serif;">\r\n                          {{var deallist.product_saveprice}} \r\n                        </td>\r\n                      </tr>\r\n                    </tbody></table>\r\n                  </div>\r\n                  <div style="padding: 8px 0pt 0pt 0px;">\r\n                    <table width="262" cellspacing="0" cellpadding="0">\r\n                      <tbody><tr>\r\n                        <td style="border: 1px solid rgb(232, 232, 232); padding: 0pt 5px 10px 0px; width: 217px; min-height: 116px;">\r\n                          <table cellspacing="0" cellpadding="0">\r\n                            <tbody><tr>\r\n                              <td style="margin: 0pt; padding: 10px 0pt 7px; font-weight: 700; font-size: 15px; color: rgb(0, 0, 0); font-family: Helvetica,Arial,sans-serif;">\r\n                                Company Information:\r\n                              </td>\r\n                            </tr>\r\n                            <tr>\r\n                               <td style="margin: 0pt; padding: 0pt; font-size: 12px; color: rgb(0, 0, 0); font-family: Helvetica,Arial,sans-serif;">\r\n                               {{var deallist.company_address}}                              </td>\r\n                            </tr>\r\n                            <tr>\r\n                              <td style="margin: 0pt; padding: 0pt; font-size: 13px; color: rgb(0, 0, 0); font-family: Helvetica,Arial,sans-serif;">\r\n                                <a target="_blank" title="{{var deallist.companywebsite }}" style="color: rgb(9, 129, 190);" href="{{var deallist.companywebsite }}"> {{var deallist.companywebsite }}</a>\r\n                              </td>\r\n                            </tr>\r\n                            \r\n                           \r\n                          </tbody></table>\r\n                        </td>\r\n                      </tr>\r\n                    </tbody></table>\r\n                  </div>\r\n                </td>\r\n                <td valign="top">\r\n                <a href="{{store url=""}}" target="_blank" style="color:#1E7EC8;"> <img src="{{var deallist.Productimage}}"  border="0"></a>\r\n                </td>\r\n              </tr>\r\n              \r\n              <tr>\r\n                <td colspan="2">\r\n                  <table width="720" cellspacing="0" cellpadding="0">\r\n                    <tbody><tr>\r\n                      <td valign="top" style="margin: 0pt; padding: 10px 0pt 0pt 20px; line-height: 15px; font-size: 12px; color: rgb(0, 0, 0); font-family: Helvetica,Arial,sans-serif;">\r\n                         {{var deallist.product_description}} \r\n                          <a href="{{store url=''''}}" target="_blank" style="color:#1E7EC8;">Read More...</a>\r\n                        </p>\r\n                       \r\n                      </td>\r\n                   \r\n                    </tr>\r\n                  </tbody></table>\r\n                </td>\r\n              </tr>\r\n            </tbody></table>\r\n          </td>\r\n        </tr>\r\n      </tbody></table>\r\n      <table width="720" style="background-color: rgb(222, 237, 204); margin-top: 2px;">\r\n        <tbody><tr>\r\n          <td style="padding: 10px; font-family: Helvetica,Arial,sans-serif; color: rgb(84, 84, 84); font-weight: 700; font-size: 12px; text-align: center; line-height: 16px;">\r\n            Need help? Have feedback? Feel free to\r\n          <a href="mailto:{{config path=''trans_email/ident_support/email''}}"><font face="Arial" color="#0099CC" size="1">{{config path=''trans_email/ident_support/email''}}</font></a>       </td>\r\n        </tr>\r\n      </tbody></table>\r\n    </div>\r\n    <table width="720" cellspacing="0" cellpadding="0">\r\n      <tbody><tr>\r\n        <td align="center">\r\n         \r\n          <p style="border-top: 1px solid rgb(206, 206, 206); margin: 3px; font-size: 11px; font-family: Helvetica,Arial,sans-serif; color: rgb(146, 146, 146); padding-top: 10px;">\r\n            Delivered by\r\n            <a target="_blank" style="color: rgb(9, 129, 190);" href="{{store url=''''}}">{{var store.getFrontendName()}}</a>\r\n            Call us: {{config path=''general/store_information/phone''}}\r\n          </p>\r\n          <p style="margin: 3px; font-size: 10px; font-family: Helvetica,Arial,sans-serif; color: rgb(204, 204, 204); padding-top: 5px;">\r\n            To purchase the {{var store.getFrontendName()}} voucher described in today''s deal, you must press the Buy! Button and follow the instructions.  Once you make the purchase, you will receive the voucher via e-mail.  This e-mail is not a valid {{var store.getFrontendName()}} voucher, even if you buy today''s deal - the only valid voucher is the voucher you receive via e-mail from {{var store.getFrontendName()}} after your purchase.\r\n          </p>\r\n        </td>\r\n      </tr>\r\n    </tbody></table>\r\n  </div>', '', 2, '{{config path="general/store_information/name"}} Newsletter', NULL, NULL, '2010-08-20 09:38:40', '2010-09-24 11:52:28', 'catalog_newsletter_email_template', ''),
(4, 'Deal Owner List', '<!--@vars\r\n{"var deallist.content":"Sender Name"\r\n@-->\r\n<div style="border: 5px solid rgb(222, 237, 204); margin: 5px 0pt; padding: 20px; width: 670px; ">\r\n      \r\n      \r\n {{var deallist.content}}\r\n</div>\r\n\r\n<table border="0" cellpadding="0" cellspacing="0">\r\n <tbody><tr>\r\n  <td style="padding: 0cm;">\r\n\r\n  <p style="margin: 2.25pt; text-align: center;" align="center"><span style="font-size: 8.5pt; color: rgb(146, 146, 146);">Delivered\r\n  by <a href=''{{config path="web/secure/base_url"}}'' title="Deal" target="_blank">{{var store.getFrontendName()}}</a> {{config path="general/store_information/address"}} </span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>', '', 2, '{{config path="general/store_information/name"}} List of Deals', NULL, NULL, '2010-08-20 09:39:30', '2010-09-24 11:51:42', 'catalog_email_email_template', '');
